import React, { Component } from "react";
import { Link } from 'react-router-dom'


class Home extends Component {
    render() {
        return (
          <div className="container airtime">
            <div className="intro ">
              <h1> About Me </h1>
              <h3> Hi, I'm Kelvin </h3>
              <p>
                {" "}
                I am a Full-stack web developer that love exploring new
                technologies{" "}
              </p>
              <p>
                {" "}
                Creating Custom Software Applications to solve people's Needs
                both here in Nigeria and outside the country.
              </p>
            </div>

            <div className="container">
              <p> What i do</p>
              <div className="row">
                <div className="col card-body">
                  I develop applications to meet standard requirment. I have experience in  building dynamic and static web
                  applications. I design and develop web projects of any
                  complexity and magnitude. Under website development services,
                  i  use modern web development stacks and software tools such
                  as: PHP (Laravel),  Python (Django and Flask) , Javascript
                  (Node, React), HTML and Css, etc
                </div>
              </div>
            </div>
          </div>
        );

    }

}

export default Home;
